import React , {useState , useEffect} from 'react';
// https://www.swiggy.com/dapi/misc/place-autocomplete?input=sai&types=
const LocationSelector = ({ handleLocationChange  , handleModalClose}) => {
  
  let [userLocationSearch , setUserLocationSearch] = useState("")
  
    return (
    <div style={{ textAlign: "center" }}>
      <input
        placeholder='search locations' 
        userLocationSearch = {userLocationSearch}
        onChange={()=>{setUserLocationSearch}}
        name="locations" />
      <br />
      <br />
      <label>
        <input type="radio" onChange={() => handleLocationChange({ lat: "17.4485835", long: "78.39080349999999" })} name="locations" />
        Madhapur
      </label>
      <br />
      <label>
        <input type="radio" onChange={() => handleLocationChange({ lat: "17.492838", long: "78.54690149999999" })} name="locations" />
        Sainikpuri
      </label><br/><br/>
      <button type="button" class="btn btn-danger" onClick={handleModalClose}>Change Location</button>
    </div>
  );
};

export default LocationSelector;
